import Vue from 'vue';
import Router from 'vue-router';

// views
import HomePage from '../views/HomePage.vue';

Vue.use(Router);

export default new Router ({
  mode: "hash",
  routes: [
    {
      path: '/',
      name: 'home',
      component: HomePage,
    },
  ]
})
